import Logout from "../../multimedia/png/logout.png"
import { signOut } from "firebase/auth"
import { auth } from "../../Services/firebase"


const SignOut = () => {
    const logOut = () => {
        signOut(auth)
    }
    return( <div className="flex flew-row justify-bewteen my-2 lg:my-0">
                <p>Salir</p>
                <input type="image" src={Logout} onClick={logOut} alt='black door with arrow as logout icon' width={30} height={30} value="Salir" className="bg-yellow-500 "/>
            </div>

    )
}

export default SignOut
